impl Solution {
    pub fn find_prime_pairs(n: i32) -> Vec<Vec<i32>> {
        fn is_prime(x: i32) -> bool {
            if x <= 1 {
                return false;
            }
            for i in 2..=((x as f64).sqrt() as i32) {
                if x % i == 0 {
                    return false;
                }
            }
            true
        }

        let mut result = Vec::new();
        for i in 1..=n / 2 {
            if is_prime(i) && is_prime(n - i) {
                result.push(vec![i, n - i]);
            }
        }

        result
    }
}
